import React,{Component} from "react";
import { Link } from 'react-router-dom';
import './Home.css';

class Home extends Component{

  constructor(props){
    super(props)
  }

  render () {
    return (
      <div className="Home-header">
          <button type="button" className="button" onClick={this.props.history.push("/signIn")}> Iniciar Sesion </button> 
      </div>
    );
  }
}
export default Home;
